import React, { Component } from "react";
import { connect } from "react-redux";

class App extends Component {
  render() {
    console.log(this.props.testStore);
    return (
      <div className="App">
        <ul>
          {this.props.testStore.map((shopName, index) => (
            <li>
              {" "}
              key={index}>{shopName}
            </li>
          ))}
        </ul>
      </div>
    );
  }
}

export default connect(
  state => ({
    testStore: state
  }),
  dispatch => ({})
)(App);
